use nycFlights;

CREATE TABLE Planes(
   tailnum      VARCHAR(6) NOT NULL PRIMARY KEY
  ,year         VARCHAR(4)   NULL
  ,type         VARCHAR(24)   NULL
  ,manufacturer VARCHAR(29)   NULL
  ,model        VARCHAR(20)   NULL
  ,engines      INTEGER    NULL
  ,seats        VARCHAR(3)   NULL
  ,speed        VARCHAR(3)   NULL
  ,engine       VARCHAR(13)   NULL
);
